CREATE TABLE `emoticon`
(
    `id`            int(10) unsigned                                              NOT NULL AUTO_INCREMENT COMMENT '表情Id',
    `name`          varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci          DEFAULT NULL COMMENT '表情名称',
    `url`           varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '表情图片',
    `keywords`      varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci          DEFAULT NULL COMMENT '关键词',
    `ref_count`     int(11)                                                                DEFAULT '0' COMMENT '被使用次数',
    `ref_stat_time` datetime                                                               DEFAULT NULL COMMENT '最近使用次数的统计时间',
    `created_at`    datetime                                                      NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci COMMENT ='表情表';

